measurements.description:
Sixteen, well presented non-resupinate flowers and 12 buds on three up to 26-cm unsupported, erect, sequentially blooming inflorescences;
 sepals and petals narrowly lanceolate, twisted, arranged in a cone shape under the lip, light green, purple blush exterior tips;
 lip clam-shell shaped, light green broadly striped dark purple, overlaid dark purple distal half, fading centrally distally;
 column upright light green, anther cap yellow;
 substance firm; texture diamond dust.
